import React from 'react';
import './Navbar.css';
import logoo from '../assets/logo.png';

const Navbar = () => {
  return (
    <div className='navbar'>
      <div className='nav-logo'>
        <img src={logoo} alt=""/>
        <p>XYZ</p>
      </div>

      <div className='nav-menu-container'>
        <ul className="nav-menu">
          <li>About</li>
          <li>Services</li>
          <li>Blog</li>
          <li>Instagram</li>
          <li>Resources</li>
        </ul>
      </div>
    </div>
  );
}

export default Navbar;
